import React from 'react';
import Logbtn from "./Logbtn";
import "../styles/header.css"
import Search from "./Search";
const Header = () => {
    return (
        <div className={"header"}>
            <h1>BooKz</h1>
            <nav className={"nav"}>
                <ul >
                    <li>
                        Main
                    </li>
                    <li>
                        Books
                    </li>
                    <li>
                        About
                    </li>
                    <li>
                        My shelf
                    </li>
                </ul>
            </nav>
            <Search/>
            <Logbtn/>
            
        </div>
    );
};

export default Header;
